import React from "react";
import styled from "styled-components";
import Hero from "../components/landingpage/Hero";
import Navbar from "../components/landingpage/Navbar";
import Features from "../components/landingpage/Features";

const Wrapper = styled.div`
  width: 100%;
`;
const IconStyle = styled.div`
  @media (max-width: 860px) {
    margin: 0 auto;
  }
`;
const TitleStyle = styled.h2`
  width: 100%;
  max-width: 300px;
  margin: 0 auto;
  padding: 40px 0;
  @media (max-width: 860px) {
    padding: 20px 0;
  }
`;
const SubtitleStyle = styled.p`
  width: 100%;
  max-width: 300px;
  margin: 0 auto;
`;

const Landing = ({ icon, title, subtitle }) => {

  let getIcon;

  switch (icon) {
    case "one":
      getIcon = <RollerIcon />;
      break;
    case "monitor":
      getIcon = <MonitorIcon />;
      break;
    case "browser":
      getIcon = <BrowserIcon />;
      break;
    case "printer":
      getIcon = <PrinterIcon />;
      break;
    default:
      getIcon = <RollerIcon />;
      break;
  }

  return (
    <div>
      <Navbar />
      <Hero />
      <Features />
    </div>
  );
};

export default Landing;
